(function () {
      console.log(window.devicePixelRatio + " DPR");
       
    document.addEventListener('CNContentInterfaceLoaded', function(){
        var innerWidth = window.innerWidth;
        var innerHeight = window.innerHeight;
        var ratio = innerHeight / innerWidth;
        console.log(window.devicePixelRatio + " DPR");
        var game = new Phaser.Game(Math.ceil(innerWidth * window.devicePixelRatio), innerHeight * window.devicePixelRatio, Phaser.WEBGL, 'game');
        game.dpr = ratio;
        game.state.add('Game', BasicGame.Game);
        game.state.start('Game');
    });
})();